// ImageUploadPage.js
import React, { useState, useEffect } from 'react';
import ImageCard from '../components/ImageCard';

const ImageUploadPage = () => {
  const [username] = useState('user2');
  const [image, setImage] = useState(null);
  const [user, setUser] = useState([]);
  const [uploadedImages, setUploadedImages] = useState([]);

  useEffect(() => {
    const userData = [
      {
        "user": "user1",
        "images": [
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,"
        ]
      },
      {
        "user": "user2",
        "images": [
          "data:image/png;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,"
        ]
      }
    ];

    const foundUser = userData.find((userData) => userData.user === username);

    if (foundUser) {
      setUser(foundUser);
    }
  }, [username]);

  const handleImageChange = (e) => {
    const selectedImage = e.target.files[0];
    setImage(selectedImage);
  };

  const handleUpload = () => {
    if (image) {
      setTimeout(() => {
        setUser((prevUser) => {
          return {
            ...prevUser,
            images: [...prevUser.images, URL.createObjectURL(image)],
          };
        });

        setImage(null);
      }, 1000);
    }
  };

  return (
    <div style={{ textAlign: 'center', padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ color: '#333', marginBottom: '20px' }}>User Image Upload Page</h1>

      <div style={{ marginBottom: '20px' }}>
        <label htmlFor="uploadImage" style={{ fontSize: '16px', marginRight: '10px' }}>
          Upload Image:
        </label>
        <input
          type="file"
          id="uploadImage"
          accept="image/*"
          onChange={handleImageChange}
          style={{ cursor: 'pointer' }}
        />
      </div>

      <button
        onClick={handleUpload}
        style={{
          backgroundColor: '#4caf50',
          color: '#fff',
          padding: '10px 20px',
          border: 'none',
          borderRadius: '4px',
          cursor: 'pointer',
          fontSize: '16px',
        }}
      >
        Upload
      </button>

      <hr style={{ margin: '40px 0', borderColor: '#ddd' }} />

      <h2 style={{ color: '#333', marginBottom: '20px' }}>Uploaded Images</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
        {user.images &&
          user.images.map((uploadedImage, index) => (
            <ImageCard key={index} imageUrl={uploadedImage} />
          ))}
      </div>
    </div>
  );
};

export default ImageUploadPage;
